import React, { Component } from "react";
import ReactDOM from "react-dom";

import Card from "./Card";

const App = () => {
  return (
    <div>
      <App />
      <App />
      <App />
    </div>
  );
};

ReactDOM.render(<App />, document.querySelector("#root"));
